  return (
    <div>
      <button onClick={() => (result > 0 ? setResult(result - 1) : '')}>
        -
      </button>
      <button onClick={() => setResult(0)}>reset</button>
      <button onClick={() => setResult(result + 1)}>+</button>
    </div>
  )
}

export default Buttons
